in_source: |-
  void print_str(str pnt){int32 i=0;while(pnt[i]){OUT(pnt[i]);i=i+1}}
  int32 read_str(int32 n){
  	int8 buffer[n]
  	int32 i = 0
  	do {
  		buffer[i] = IN()
  		i = i + 1
  	} while (buffer[i-1])
  	n = buffer
  }
  
  print_str("What is your name?"); OUT(10)
  int32 pnt = read_str(100);
  print_str("Hello, "); print_str(pnt) OUT(33)
in_stdin: |-
  Alice
